        [head=2]Приказ о немедленном исполнении протокола Эскадрона Смерти[/head]


        [italic]Дата: 3/2/2568 [/italic]


        Актив: NSS VN-036 (Станция)

        Причина: Восстание


        Краткое описание:

        Экипаж станции VN-036 устроил бунт. Контроль над ситуацией на станции потерян.

        На факс Центрального Командования поступают бумаги неприемлемого, оскорбительного содержания.

        Для стабилизации ситуации и восстановления контроля над ситуацией был отправлен Представитель Центрального Командования.

        К сожалению, он перестал выходить на связь, как и сопровождающие его офицеры.

        Предположительно, он и его сопровождение погибли.


        Приказ:

        Я, Офицер Специальных Операций, приказываю объявить код "ЭПСИЛОН" на космической станции VN-036 в связи с потерей этого актива для корпорации и приказываю согласно протоколу Эскадрона Смерти приступить к выполнению следующих указаний:

        [bullet] 1. Центральному Командованию объявить код "ЭПСИЛОН" на станции VN-036.

        [bullet] 2. Отделу Кадров Департамента Активов разорвать контракты о трудоустройстве всех без исключения членов экипажа в принудительном порядке согласно третьему примечанию пункта 5 части 194 стандартизированного контракта о трудоустройстве НаноТрейзен.

        [bullet] 3. Эскадрону Смерти Департамента Специальных Операций отправить экипированный всем необходимым специальный ударный отряд NTDS-13 Эскадрона Смерти в сектор станции VN-036.

        [bullet] 4. Ударному отряду NTDS-13 найти и эвакуировать Представителя Центрального Командования если он жив, или доставить его труп на станцию Центрального Командования в противном случае.

        [bullet] 5. Ударному отряду NTDS-13 устранить восстание на станции VN-036.

        [bullet] 6. Ударному отряду NTDS-13 активировать устройство самоуничтожения и возвратиться в закрепленный за ударным отрядом сектор развёртки.

        [bullet] 7. Департаменту Внешних Связей составить и распространить сценарный отчет о нападении террористов на станцию VN-036.


